window.Imagecow={cookie_seconds:3600*24,cookie_name:"Imagecow_detection",cookie_path:"/",init:function(){var e=this.getClientDimensions();var t=this.getConnectionSpeed();var n="dimensions,"+e+"|speed,"+t;if(n!=this.getCookie()){this.setCookie(n)}},getClientDimensions:function(){if(typeof window.innerWidth!="undefined"){return window.innerWidth+","+window.innerHeight}else if(typeof document.documentElement!="undefined"&&typeof document.documentElement.clientWidth!="undefined"&&document.documentElement.clientWidth!=0){return document.documentElement.clientWidth+","+document.documentElement.clientHeight}else{return document.getElementsByTagName("body")[0].clientWidth+","+document.getElementsByTagName("body")[0].clientHeight}},getConnectionSpeed:function(){var e=navigator.connection||{type:0};switch(e.type){case e.CELL_3G:case e.CELL_2G:return"slow"}return"fast"},setCookie:function(e){var t=new Date;t.setTime(t.getTime()+this.cookie_seconds*1e3);var n="; expires="+t.toGMTString();document.cookie=this.cookie_name+"="+e+n+"; path="+this.cookie_path},getCookie:function(){var e=this.cookie_name+"=";var t=document.cookie.split(";");for(var n=0;n<t.length;n++){var r=t[n];while(r.charAt(0)==" "){r=r.substring(1,r.length)}if(r.indexOf(e)==0){return r.substring(e.length,r.length)}}return null},deleteCookie:function(){var e=new Date;e.setTime(e.getTime()-1e3);var t="; expires="+e.toGMTString();document.cookie=this.cookie_name+"="+t+"; path="+this.cookie_path}}